import styles from './Button.module.css';

const Button = props => {
    // events
    const clickHandler = event => {
        event.preventDefault();
        // fire off call back up to parent
        props.onAddUser();
    }

    return <button className={styles.button} type={props.type} onClick={clickHandler}>{props.children}</button>
}

export default Button;
